const atm = function (amount) {
  const denoms = [2000, 500, 100, 50, 20, 10, 5, 2, 1];
  let temp = amount;

  return denoms.reduce(function (notes, denom) {
    const count = Math.floor(temp / denom);
    if (count > 0) {
      notes[denom] = count;
    }
    temp %= denom;
    return notes;
  }, {});
};

