const factorial = function (number) {
  let fact = 1;

  if (number < 0) {
    return 0;
  }

  for (let count = 2; count <= number; count++) {
    fact *= count;
  }

  return fact;
};

const nthFibonacci = function (n) {
  let first = 0;
  let second = 1;
  let third = 0;

  if (n <= 1) {
    return first;
  }

  for (let i = 2; i < n; i++) {
    third = first + second;
    first = second;
    second = third;
  }

  return second;
};

