};

const map = function(array, mapper) {
  const result = [];

  for(let index = 0; index < array.length; index++) {
    result.push(mapper(array[index]));
  }

  return result;
};

const filter = function(array, predicate) {
  const result = [];

  for(let index = 0; index < array.length; index++) {
    if(predicate(array[index])) {
      result.push(array[index]);
    }
  }

  return result;
};

const reduce = function(array, reducer, initialValue) {
  let result = initialValue;

  for(let index = 0; index < array.length; index++) {
    result = reducer(result, array[index]);
  }

  return result;
};

const predicate = function(element) {
  return element % 2 === 0;
};

const reducer = function(accumulator, element) {
  return accumulator + element;
};

