const numberToWords = function (num) {
  const units = [
    'zero',
    'one',
    'two',
    'three',
    'four',
    'five',
    'six',
    'seven',
    'eight',
    'nine',
    'ten',
    'eleven',
    'twelve',
    'thirteen',
    'fourteen',
    'fifteen',
    'sixteen',
    'seventeen',
    'eighteen',
    'nineteen',
  ];
  const tens = [
    '',
    '',
    'twenty',
    'thirty',
    'fourty',
    'fifty',
    'sixty',
    'seventy',
    'eighty',
    'ninety',
  ];

  let result = '';
  let number = num;
  let temp = 0;

  if (number < 20) {
    return units[number];
  }

  temp = Math.floor(number / 1000);
  if (temp != 0) {
    result += units[temp] + ' thousand ';
    number %= 1000;
  }

  temp = Math.floor(number / 100);
  if (temp != 0) {
    result += units[temp] + ' hundred ';
    number %= 100;
  }

  temp = Math.floor(number / 10);
  result += tens[temp] + ' ';
  number %= 10;

  if (number != 0) {
    result += units[number];
  }

  return result;
};

