const removeAdjacentDuplicates = function(numbers) {
  const result = [];

  for(let index = 0; index < numbers.length; index++) {
    if(numbers[index] !== numbers[index + 1]) {
      result.push(numbers[index]);
    }
  }

  return result;
};

const hasAnyVowel = function(str) {
  const vowels = /[aeiouAEIOU]/;
  return str.search(vowels) !== -1;
};

const hasAnyConsonant = function(str) {
  const consonants = /[bcdfghjklmnpqrstvwxyz]/;
  return str.toLowerCase().search(consonants) !== -1;
};

const hasAllConsonants = function(str) {
  const notConsonants = /[^bcdfghjklmnpqrstvwxyz]/;

  return str.toLowerCase().search(notConsonants) === -1;
};

